//配置文件：axiosapi.js
import axios from "axios";
const axiosapi = axios.create({
    baseURL: '/127.0.0.1:5000', //基础的服务器地址
    timeout: 5000  //连接超时的时间(单位是毫秒)
})
export default axiosapi  //axiosapi是axios的实例
